import { Box, Button, Heading } from '@chakra-ui/react';

const App = () => {
  return (
    <Box textAlign="center" fontSize="xl">
      <Heading as="h1" size="2xl" mb={4}>
        Student Management Dashboard
      </Heading>
      <Button colorScheme="teal" size="lg">
        Get Started
      </Button>
    </Box>
  );
}

export default App;
